import React from 'react'; // Import the Component component from React
import {Link} from 'react-router-dom'; // Import the Link component


function Thumbnail(props) {
  return (
    <div className={props.col} key={props.title}>
      <Link to={props.link}>
        <div className="portfolio-item" onMouseOver={props.changeBackground}>
          <div className="portfolio-item-img set-bg" style={{backgroundImage: "url(" + props.image + ")"}}>
            <div className="pi-inner" key={props.title}>
              <h3 className="project-question" key={props.title}>{props.question}</h3>
              <h2 className="project-title" key={props.title}>{props.title}</h2>
            </div>
          </div>
        </div>
      </Link>
    </div>
  );
}

export default Thumbnail;
